import React from "react";

function Dashboard() {
  return (
    <div style={{ height: "100vh", width: "80vw", backgroundColor: "#EDEDED" }}>
    <div style={{height:"40vh",width:"%",backgroundColor:"green"}}></div>
    </div>
  );
}

export default Dashboard;
